import sys

def main():
    s = sys.stdin.readline().strip()
    month = s[2:4]
    year = s[0:2]
    if int(month) <= 12 and int(year) <= 12:
        print("AMBIGUOUS")
    elif int(month) <= 12:
        print("MMYY")
    elif int(year) <= 12:
        print("YYMM")
    else:
        print("NA")

if __name__ == '__main__':
    main()

